var PlansManager = function (params) {
    params = params || {};
    this.plans = [];
    this.filterTags = [];
    this.parent = document.getElementById(params.containerId);
    this.root = document.createElement("ul");
    this.parent.appendChild(this.root);
}

PlansManager.prototype = {
    updatePlanTags: function (hideAll, showAll) {
        //this.plansByTag.length = 0;
        //console.log("Updating plan tags.");
        var len = this.plans.length;
        while (len--) {
            if (hideAll == true) {
                this.plans[len].visible = false;
            } else if (showAll == true) {
                this.plans[len].visible = true;
            } else {
                this.plans[len].applyTagFilters(this.filterTags);
                //console.log(this.plans[len]);
            }
        }
    },
    addTagFilter: function (tagType, tagVal) {
        var tag = new PlanTag(tagType, tagVal);
        if (tag.isValid) {
            this.filterTags.push(tag);
            //console.log("Filter Added:" + tagVal);
            this.updatePlanTags();
        } else {
            console.log("Invalid tag", tagType, tagVal);
        }
        //console.log("Current Filters:", this.filterTags);
    },
    hideAll: function () {
        this.updatePlanTags(true);
        //console.log("hidding all");
    },
    showAll: function () {
        this.updatePlanTags(false, true);
    },
    clearTagFilters: function () {
        this.filterTags.length = 0; //clear array
        this.updatePlanTags();
    },
    appendPlan: function (planObject) {
        this.plans.push(planObject);
        planObject.onChange(this.onPlanChangeCallback);
        //console.log("Plan appended:", planObject);
    },
    loadJSON: function (jsonQueryPath, onCompleteCallback) {
        var self = this;
        $.getJSON(jsonQueryPath, function (data) {
            $.each(data, function (key, val) {
                var tags = [];
                //create tag objects
                _.each(val.tags, function (tagStr, tagType) {
                    tags.push(new PlanTag(tagType, tagStr));
                });
                //append plans
                self.appendPlan(new Plan({
                    parent: self.root,
                    title: val.title,
                    subtitle: val.subtitle,
                    url: val.url,
                    description: val.description,
                    days: val.days,
                    level: val.level,
                    iconType: val.iconType,
                    complexion: val.complexion,
                    gender: val.gender,
                    tags: tags,
                }));
            });
        }).done(function () {
            self.updatePlanTags();
            onCompleteCallback && onCompleteCallback();
        });
    },
    onPlanChange: function (callback) {
        this.onPlanChangeCallback = callback;
    }
}

Object.defineProperty(PlansManager.prototype, "partialMatchEnabled", {
    get: function () {
        return this._partialMatchEnabled;
    },
    set: function (value) {
        if (value != this._partialMatchEnabled) {
            this.updatePlanTags();
        }
    }
});

Object.defineProperty(PlansManager.prototype, "count", {
    get: function () {
        var len = this.plans.length,
			res = 0;
        while (len--) {
            res += this.plans[len].visible ? 1 : 0;
        }
        return res;
    },
});

PlansManager.prototype.constructor = PlansManager;

