var PlanTag = function (tagType, tagValue) {
    this._type = tagType;
    this._value = tagValue;
    this._isValid = false;
    this._id = -1;
    this.update();
}

PlanTag.prototype = {
    update: function () {
        this._isValid = PlanTag.tagTypes[this._type] || false;
        this._id = this._isValid && "T" + Math.abs((this._type + this._value).hashCode()) || -1;
    }
}

PlanTag.tagTypes = { 'gender': true, 'level': true, 'body-target': true, 'complexion': true };

Object.defineProperty(PlanTag.prototype, "isValid", {
    get: function () {
        return this._isValid;
    },
});

Object.defineProperty(PlanTag.prototype, "id", {
    get: function () {
        return this._id;
    },
});

Object.defineProperty(PlanTag.prototype, 'type', {
    get: function () {
        return this._isValid ? this._type : 'unknown';
    }
});

Object.defineProperty(PlanTag.prototype, "label", {
    get: function () {
        return this._value.toUpperCase();
    }
});

PlanTag.prototype.constructor = PlanTag;

