var TestBar = (function () {
    var isCollapsed = true,
	  sizeCollapsed = 86,
	  sizeExpanded = 208,
	  isVisible = false,
	  // enable or disable the collapse/expand on mouse hover
	  autoExpandEnabled = false,
	  selectionUpdateCallback = null,
	  expandCallback = null,
	  collapseCallback = null,
	  filterSettings = null,
	  barSelector = $(".test-wrapper"),
	  toolTip = $("#plans-test .tooltip");

    var setTooltipVisible = function (visible) {
        // if (barSelector.find("li.selected").length == 0 ){
        // 	var time = visible ? 0.3 : 0.2
        // 	TweenMax.killTweensOf(toolTip);
        // 	TweenMax.fromTo(toolTip, time, {
        // 		top: visible == true ? -20 : -45
        // 	},{
        // 		top: visible == true ? -45 : -20,
        // 		autoAlpha: visible == true ? 1 : 0,
        // 		delay: visible ? 0.15 : 0,
        // 		ease: Cubic.easeOut,
        // 	});
        // } else if (isCollapsed == true){
        // 	TweenMax.set(toolTip, {autoAlpha: 0});
        // }
    };

    var collapse = function () {
        TweenMax.to(barSelector, 0.25, {
            height: sizeCollapsed,
            ease: Cubic.easeOut
        });
        isCollapsed = true;
        setTooltipVisible(false);
        if (_.isFunction(collapseCallback)) {
            collapseCallback();
        }
    };

    var expand = function () {
        TweenMax.to(barSelector, 0.35, {
            height: sizeExpanded,
            ease: Cubic.easeOut
        });
        isCollapsed = false;
        setTooltipVisible(true);
        if (_.isFunction(expandCallback)) {
            expandCallback();
        }
    };

    var show = function () {
        isVisible = true;
        barSelector.css("display", "block");
        TweenMax.to(barSelector, 0.2, {
            autoAlpha: 1,
            y: 0,
            height: sizeCollapsed,
            ease: Cubic.easeOut,
        });
    };

    var hide = function (skipAnimation) {
        isVisible = false;
        if (skipAnimation) {
            TweenMax.set(barSelector, {
                autoAlpha: 0,
                y: -100,
                height: 0,
                onComplete: function () {
                    $(this.target).css("display", "none");
                }
            });
        } else {
            TweenMax.to(barSelector, 0.2, {
                autoAlpha: 0.5,
                y: -100,
                height: 0,
                ease: Cubic.easeIn,
                onComplete: function () {
                    $(this.target).css("display", "none");
                }
            });
        }
    };

    var reset = function () {
        barSelector.find('li').removeClass('selected');
        barSelector.find("li").not(".none").css("display", "none");
        TweenMax.set(barSelector.find("li.none"), {
            autoAlpha: 1
        });
    };

    var updateSelection = function () {
        if (barSelector.find("li.selected").length == 4) {
            filterSettings = {
                gender: barSelector.find('#gender li.selected span').attr('data-tag'),
                complexion: barSelector.find('#complexion li.selected span').attr('data-tag'),
                level: barSelector.find('#level li.selected span').attr('data-tag'),
                'body-target': barSelector.find('#body-target li.selected span').attr('data-tag')
            };
            if (_.isFunction(selectionUpdateCallback)) {
                selectionUpdateCallback(filterSettings);
            }
        } else {
            filterSettings = null;
        }
    };

    //Ul list element
    var bindElementMenu = function (domElement) {
        var isOdd = function (num) { return (num % 2) == 1; }
        $(domElement).hover(function (e) { //EXPAND
            setTooltipVisible(false);
            $(this).addClass('expanded').removeClass('collapsed');
            TweenMax.to($(this).find(".none"), 0.2, { autoAlpha: 0 });

            var top, bottom;
            if (BrowserDetect.browser == "Firefox") {
                top = bottom = 7;
            } else {
                top = bottom = 17;
            }
            var count = $(this).find("li").not(".none").length;
            $(this).find("li").not(".none").each(function (idx, el) {
                //console.log(idx, el);
                topTarget = isOdd(count) ? 17 : -13
                if (isOdd(idx) && idx > 0) {
                    if (BrowserDetect.browser == "Firefox") {
                        bottom += isOdd(count) ? 47 : 24;
                    } else {
                        bottom += isOdd(count) ? 72 : 42;
                    };
                    topTarget = bottom;
                } else if (idx > 0) {
                    if (BrowserDetect.browser == "Firefox") {
                        top -= isOdd(count) ? 49 : 42;
                    } else {
                        top -= isOdd(count) ? 72 : 42;
                    }
                    topTarget = top;
                }
                $(el).css("display", "block");
                TweenMax.to(el, 0.15, { autoAlpha: 1, top: topTarget });
            });
        }, function (e) { // COLLAPSE
            setTooltipVisible(true);
            $(this).addClass('collapsed').removeClass('expanded');
            TweenMax.to($(this).find("li").not(".selected, .none"), 0.2, { top: 17, autoAlpha: 0, ease: Cubic.easeOut });
            TweenMax.to($(this).find("li.selected"), 0.25, { top: 17, ease: Cubic.easeOut });
            if ($(this).find(".selected").length == 0) {
                TweenMax.to($(this).find(".none"), 0.2, { autoAlpha: 1 });
            } else {
                TweenMax.set($(this).find(".none"), { autoAlpha: 0 });
            }
            e.stopPropagation();
        });
        $(domElement).find("li").not(".none").click(function (e) {
            $(this).parent().find('li').not('none').removeClass('selected');
            $(this).addClass('selected');
            $(this).trigger("mouseleave");
            updateSelection();
        })
    };

    return {
        bind: function () {
            bindElementMenu(barSelector.find("#gender"));
            bindElementMenu(barSelector.find("#complexion"));
            bindElementMenu(barSelector.find("#level"));
            bindElementMenu(barSelector.find("#body-target"));

            barSelector.hover(function () {
                autoExpandEnabled == true && expand();
            }, function () {
                autoExpandEnabled == true && collapse();
            });
        },
        isVisible: function () { return isVisible },
        onSelectionUpdate: function (callback) {
            selectionUpdateCallback = callback;
        },
        onExpand: function (callback) {
            expandCallback = callback;
        },
        onCollapse: function (callback) {
            collapseCallback = callback;
        },
        setAutoExpandEnabled: function (enabled) {
            autoExpandEnabled = enabled;
        },
        getFilterSettings: function () {
            return filterSettings;
        },
        collapse: collapse,
        expand: expand,
        hide: hide,
        show: show,
        reset: reset
    };
});

