var IntroAnimation = (function () {
    selectors = {
        title: $("header h1"),
        background: $("#main-page"),
        left: {
            title: $(".left h2"),
            text: $(".left p"),
        },
        right: {
            title: $(".right h2"),
            text: $(".right p")
        },
    }

    function hideAll() {
        var s = selectors;
        TweenMax.set([s.title, s.left.title, s.left.text,
			s.right.title, s.right.text, s.background
        ], {
            autoAlpha: 0,
            x: 0,
            y: 0
        });
    }

    function start() {
        var s = selectors;
        hideAll();
        var tl = new TimelineLite({
            onComplete: function () {
                // console.log("done!")
            }
        });

        tl.fromTo(s.background, 0.75, {
            autoAlpha: 0
        }, {
            autoAlpha: 1
        });
        tl.set(s.title, {
            autoAlpha: 1
        })
			.from(s.title, 0.4, {
			    x: -180,
			    ease: Cubic.easeOut
			});

        // L E F T

        tl.set(s.left.title, {
            autoAlpha: 1
        }, "-=0.2")
			.from(s.left.title, 0.4, {
			    x: -80,
			    ease: Cubic.easeOut
			}, "-=0.2");

        tl.set(s.left.text, {
            autoAlpha: 1
        }, "-=0.3")
			.from(s.left.text, 0.4, {
			    y: 60,
			    ease: Cubic.easeOut
			}, "-=0.3");

        // R I G H T

        tl.set(s.right.title, {
            autoAlpha: 1
        })
			.from(s.right.title, 0.4, {
			    x: -80,
			    ease: Cubic.easeOut
			});

        tl.set(s.right.text, {
            autoAlpha: 1
        }, "-=0.3")
			.from(s.right.text, 0.4, {
			    y: 60,
			    ease: Cubic.easeOut
			}, "-=0.3");
    }
    return {
        hide: hideAll,
        start: start,
    }
});